import React from 'react';
import './Portfolio.css'

const Portfolio = () => {
  return (
    <>
    <section className='portfolio-section'>
        <div className='container'> 
                <h1 className='Heading'>My Portfolio</h1>
                <hr className='line'/>
                
        </div>
    </section>
    </>
  )
}

export default Portfolio
